import productiviaLogo from "../assets/Productivia_Logo.png";
import classes from "./sideBar.module.css";

const Sidebar = () => {
  return (
    <>
      <div>
        <img
          className={classes.productiviaLogo}
          src={productiviaLogo}
          alt="productiviaLogo"
        />
        <h2>Productivia</h2>
      </div>
    </>
  );
};

export default Sidebar;
